import CBCKids from '../'

class Terms extends Component{

  displayLogos(){

    switch(this.props.country){
      case 'Canada':
        return <div className="broadcasters">
          <img src=""/>
        </div>
      case 'United States':
        return <div className="broadcasters"></div>
      default:
        return  <div className="broadcasters"></div>
    }
  }
  render(){
    return(
      <footer className="terms">

      </footer>
    )
  }
}
export default Terms
